import React from "react";
import { Link } from "react-router-dom";
import { FaHome, FaSearch, FaFilm, FaShoppingCart, FaInfoCircle } from "react-icons/fa"; // Import icons from React Icons
import "./../styles/navigation.css";

function Navigation() {
  return (
    <nav className="navigation">
      <ul>
        <li><Link to="/"><FaHome /> Home</Link></li> {/* Home icon */}
        <li><Link to="/search"><FaSearch /> Search Movies</Link></li> {/* Search icon */}
        <li><Link to="/movies"><FaFilm /> Movies</Link></li> {/* Movies icon */}
        <li><Link to="/cart"><FaShoppingCart /> Cart</Link></li> {/* Cart icon */}
        <li><Link to="/about"><FaInfoCircle /> About</Link></li> {/* About icon */}
      </ul>
    </nav>
  );
}

export default Navigation;
